pivots = 0


def quicksort_comp(list):
    """ sorts without need for helper, but returns a new list
    instead of altering the input list
    """
    if len(list) < 2:
        return list

    left = quicksort_comp([x for x in list if x < list[0]])
    equal = quicksort_comp([x for x in list if x == list[0]])
    right = quicksort_comp([x for x in list if x > list[0]])

    return left + equal + right


def quicksort(list):
    """
    recurisively sorts a list and returns the
    input list, sorted
    """
    # global swaps, actions, pivots
    qs_helper(list, 0, len(list) - 1)
    # print(f'swaps: {swaps}')
    # print(f'actions: {actions}')
    # print(f'pivots: {pivots}')
    return list


def qs_helper(list, first, i_last):
    if first < i_last:
        split_point = partition(list, first, i_last)

        qs_helper(list, first, split_point - 1)
        qs_helper(list, split_point + 1, i_last)


def partition(list, first, last):
    # global swaps, actions, pivots
    pivot = list[first]
    L = first + 1
    R = last
    done = False

    while not done:
        while (L <= R) and (list[L] <= pivot):
            L += 1
            # actions += 1

        while (list[R] >= pivot) and (R >= L):
            R -= 1
            # actions += 1

        if L > R:
            done = True
        else:
            # swaps += 1
            # actions += 1
            temp = list[L]
            # actions += 1
            list[L] = list[R]
            # actions += 1
            list[R] = temp
            # actions += 1

    temp = list[first]
    # actions += 1
    list[first] = list[R]
    # actions += 1
    list[R] = temp
    # actions += 1
    # pivots += 1

    return R


